	add("catalan", "{\"term\":\"catalan\", \"etymology\":{\"influencers\":[], \"languages\":[\"Catalan\", \"English\", \"middle english (1100-1500)\", \"Spanish\", \"French\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027catalane\u0027 from Catalan \u0027catal√†\u0027 either directly or via French \u0027catalan\u0027 or Spanish \u0027catal√°n\u0027 of obscure and disputed origin:* Possibly from an indigenous name of origin and probably meaning \u0026quot;chiefs of battle\u0026quot;;* Derived from \u0027\u0027catalunya\u0027 (catalonia) a corruption of Latin \u0027Gathia launia\u0027 \u0026quot;land of the Goths\u0026quot;, or \u0027Goth-Alania\u0027 \u0026quot;land of Goths and {{w|Alans}},\u0026quot; an Iranian tribe.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Person from or inhabitant of Catalonia\", \"priority\":1}]}, \"synonyms\":{}}");

