	add("catamitism", "{\"term\":\"catamitism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|catamite|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice of keeping catamites\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1686\u0027\u0027: w:Gatien de Courtilz de Gatien de Courtilz de Sandras and Ferrand Spence, \u0027The Hi≈øtory of the \u0027Life\u0027 and \u0027Actions\u0027 of that Great Captain of his Age the Vi≈øcount\u0027 de Turenne, [http://books.google.co.uk/books?id\u003dZDQ2AAAAMAAJ\u0026amp;pg\u003dPA312\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dfCrOS6CzAoPUzQTi1NC0Ag\u0026amp;cd\u003d1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catamitism%22\u0026amp;f\u003dfalse page 312\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"T]he Vi≈øcount \u0027de Turenne\u0027‚Ä¶Remon≈øtrated to Madam \u0027de Buillon\u0027, that this Prince having us‚Äôd his fir≈øt Wife Ill, whom he had kick‚Äôd when with Child, of which ≈øhe dy‚Äôd, ‚Äõtwas expo≈øing her Daughter to the like treatment; that he was addicted to Wine and Women, Qualities not only unworthy a Per≈øon of his Rank, but all≈øo to a little \u0027\u0027Catamiti≈øm\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027: Roy Temple House and Ernst Erich Noth, \u0027Books Abroad\u0027, volume 47, issue 3, [http://books.google.co.uk/books?id\u003dNTkMAAAAIAAJ\u0026amp;q\u003d%22catamitism%22\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dsuXOS82oCaTGywTajpSmAg\u0026amp;cd\u003d7 page 574\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Exhibitionists do not like to confess their venial sins ‚Äî \u0027\u0027catamitism\u0027\u0027 and group sex, yes, petty avarice and pettier maliciousness, no: the latter faults do not make for salable reading\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027: \u0027The Scriblerian and the Kit-Cats\u0027, volume 22, [http://books.google.co.uk/books?id\u003d9V4nAQAAIAAJ\u0026amp;q\u003d%22catamitism%22\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dsuXOS82oCaTGywTajpSmAg\u0026amp;cd\u003d9 page 136\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In Satire 4, Persius attacked Nero‚Äôs ‚Äúdepilation and heterosexual‚Äù lust; Dryden substituted homosexuality, \u0027\u0027catamitism\u0027\u0027, and impotency, alluding to William‚Äôs rumored sexual liaisons with his Dutch favorites\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027: Jacqueline Long, \u0027Claudian‚Äôs \u0027In Eutropium:\u0027 Or, How, When, and Why to Slander a Eunuch\u0027, [http://books.google.co.uk/books?id\u003dkViJy2IhOIAC\u0026amp;pg\u003dPA80\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dsuXOS82oCaTGywTajpSmAg\u0026amp;cd\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catamitism%22\u0026amp;f\u003dfalse page 80\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Libanius‚Äôs invective against Philip successively despises barbarian origins in and of themselves, mocks dependency, rebukes failure to learn cultural values, snidely notes \u0027\u0027catamitism\u0027\u0027, drowns practical achievements in the immorality alleged to have won them, and further damns character with accounts of unproductive vice\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027: Leofranc Holford-Strevens, \u0027Aulus Gellius: An Antonine Scholar and His Achievement\u0027, [http://books.google.co.uk/books?id\u003dnXTWaXWlzSsC\u0026amp;pg\u003dRA1-PA207\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dsuXOS82oCaTGywTajpSmAg\u0026amp;cd\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catamitism%22\u0026amp;f\u003dfalse page 207\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Caelius will never take the allegation of \u0027\u0027catamitism\u0027\u0027 in his youth so hard‚Ä¶that is silly, for we cannot repent of things like good looks that are not of our causation\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The essence of being a catamite\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: Michael Ryan, ‚ÄúFoucault‚Äôs Fallacy‚Äù in \u0027Reconstructing Foucault: Essays in the Wake of the 80s\u0027, [http://books.google.co.uk/books?id\u003dlUsjfmXIL_AC\u0026amp;pg\u003dPA175\u0026amp;dq\u003d%22catamitism%22\u0026amp;lr\u003d\u0026amp;num\u003d100\u0026amp;as_brr\u003d0\u0026amp;ei\u003dsuXOS82oCaTGywTajpSmAg\u0026amp;cd\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catamitism%22\u0026amp;f\u003dfalse page 175\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Effeminacy‚Ä¶may not have been the quality that gave \u0027\u0027catamitism\u0027\u0027 its meaning; rather, \u0027\u0027catamitism\u0027\u0027‚Ä¶may have been the normative danger that qualified effeminacy as a threat to male heterosexual rule\", \"priority\":18}]}, \"synonyms\":{}}");

