	add("catastasis", "{\"term\":\"catastasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027Œ∫Œ±œÑŒ¨œÉœÑŒ±œÉŒπœÇ\u0027 (settling, appointment)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In classical drama, the third and penultimate section, in which action is heightened for the catastrophe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, It doubles itself in the middle of his life, reflects itself in another, repeats itself, protasis, epitasis, \u0027\u0027catastasis\u0027\u0027, catastrophe. ‚Äî James Joyce, \u0027Ulysses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, ‚ÄòThe object of the meta-theatre is precisely that ‚Äì to allow the participants to see through their first roles in it. But that is only the \u0027\u0027catastasis\u0027\u0027.‚Äô ‚Äî John Fowles, \u0027The Magus\", \"priority\":3}]}, \"synonyms\":{}}");

