	add("catbird", "{\"term\":\"catbird\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|cat|bird|lang\u003den}}, because its cry is said to resemble that of a cat.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two species of American mockingbird relatives, the grey catbird, and the black catbird\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1832\u0027\u0027, Sharon Turner, \u0027The Sacred History of the World\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027catbird\u0027\u0027‚Äôs note exactly resembles the voice of a kitten, that a stranger to it would instantly conclude that such an animal \u0026quot;had got bewildered in the branches\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, \u0027\u0027, Vintage 2004, p. 200\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I recall a \u0027\u0027catbird\u0027\u0027 high in the water oak above, swinging like a rag amid the branches, jabbering and screeching\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any of four species of Australasian bowerbirds of the genera \u0027Ailuroedus\u0027 and\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 185\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cat bird\u0027\u0027 had a forlorn cry, like a whimpering child or the animal it is named for\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A babbler-like bird from eastern Africa\", \"priority\":9}]}, \"synonyms\":{}}");

