	add("catechism", "{\"term\":\"catechism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027\u0027 from Ancient greek (to 1453) *\u0027\u0027 (Œ∫Œ±œÑŒ∑œáŒπœÉŒºœåœÇ) from \u0027Œ∫Œ±œÑŒ∑œáŒØŒ∂œâ\u0027 (to catechize) a later extended form of \u0027Œ∫Œ±œÑŒ∑œáŒ≠œâ\u0027 (to catechize, instruct, teach by word of mouth) from \u0027Œ∫Œ±œÑŒ¨\u0027 (down) + \u0027·º†œáŒ≠œâ\u0027 (to sound, to resound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A book, in question and answer form, summarizing the basic principles of Christianity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A basic manual in some subject\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A set of questions designed to determine knowledge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1925\u0027\u0027, Countee Cullen, \u0027[http://www.poetryfoundation.org/poem/171320 Yet Do I Marvel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Inscrutable His ways are, and immune\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"To \u0027\u0027catechism\u0027\u0027 by a mind too strewn\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"With petty cares to slightly understand\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"What awful brain compels His awful hand\", \"priority\":8}]}, \"synonyms\":{}}");

