	add("catechumen", "{\"term\":\"catechumen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) cat√©chum√®ne or ecclesiastical Latin catechumenus, from Ancient greek (to 1453) \u0027Œ∫Œ±œÑŒ∑œáŒøœçŒºŒµŒΩŒøœÇ\u0027 (being instructed) present participle passive of \u0027Œ∫Œ±œÑŒ∑œáŒ≠œâ\u0027 (sound through, instruct orally, catechise) from \u0027Œ∫Œ±œÑŒ¨\u0027 (down) + \u0027·º†œáŒÆ\u0027 (sound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A convert to Christianity under instruction before baptism; a young Christian preparing for confirmation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, w:Thomas Thomas Pynchon, \u0027V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Here in this room an old man had killed and boiled a \u0027\u0027catechumen\u0027\u0027, had committed sodomy with a rat, had discussed a rodent nunhood with V., a future saint ‚Äì depending which story you listened to\", \"priority\":3}]}, \"synonyms\":{}}");

	add("categoria", "{\"term\":\"categoria\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin from Ancient greek (to 1453) \u0027Œ∫Œ±œÑŒ∑Œ≥ŒøœÅŒØŒ±\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Exposure of an opponent\u0027s secret wickedness, especially in the opponent\u0027s presence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("category", "{\"term\":\"category\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027categorie\u0027 from \u0027categoria\u0027 (class of predicables) from Ancient greek (to 1453) \u0027Œ∫Œ±œÑŒ∑Œ≥ŒøœÅŒØŒ±\u0027 (head of predicables)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group, often named or numbered, to which items are assigned based on similarity or defined criteria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The traditional way of describing the similarities and differences between constituents is to say that they belong to \u0027\u0026lt;b\u0026gt;categories\u0026lt;/b\u0026gt;\u0027 of various types. Thus, words like \u0027boy\u0027, \u0027girl\u0027, \u0027man\u0027, \u0027woman\u0027, etc. are traditionally said to belong to the \u0027\u0027category\u0027\u0027 of Nouns, whereas words like \u0027a\u0027, \u0027the\u0027, \u0027this\u0027, and \u0027that\u0027 are traditionally said to belong to the \u0027\u0027category\u0027\u0027 of Determiners\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This steep and dangerous climb belongs to the most difficult \u0027\u0027category\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I wouldn\u0027t put this book in the same \u0027\u0027category\u0027\u0027 as the author\u0027s first novel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A collection of objects, together with a transitively closed collection of composable arrows between them, such that every object has an identity arrow, and such that arrow composition is associative\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One well-known \u0027\u0027category\u0027\u0027 has sets as objects and functions as arrows\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Just as a monoid consists of an underlying set with a binary operation \u0026quot;on top of it\u0026quot; which is closed, associative and with an identity, a category consists of an underlying digraph with an arrow composition operation \u0026quot;on top of it\u0026quot; which is transitively closed, associative, and with an identity at each object. In fact, a category\u0027s composition operation, when restricted to a single one of its objects, turns that object\u0027s set of arrows (which would all be loops) into a monoid\", \"priority\":7}]}, \"synonyms\":{}}");

	add("catenaccio", "{\"term\":\"catenaccio\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|it|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a system of defensive play\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cateran", "{\"term\":\"cateran\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Scottish Gaelic\"], \"text\":\"From Scottish gaelic \u0027ceatharn\u0027 (troop) \u0027ceathairne\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Highlander working as a professional fighter; a mercenary attached to a Scottish clan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1932\u0027\u0027, \u0027Sunset Song\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And the great-grandson of Cospatric, he joined the English against the \u0027\u0027cateran\u0027\u0027 Wallace [‚Ä¶\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027Glencoe\u0027, Amberley 2009, p. 41\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"They found the hire of lawyers more cost-effective than the maintenance of \u0027\u0027caterans\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A freebooter, marauder\", \"priority\":6}]}, \"synonyms\":{}}");

	add("caterer", "{\"term\":\"caterer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|cater|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person employed to obtain and maintain the storage of provisions, especially food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1821\u0027\u0027 June 19, ‚ÄùPeregrine,‚Äù \u0027The Traveller: Letter IV\u0027, in \u0027The Kaleidoscope; Or, Literary and Scientific Mirror\u0027, [http://books.google.com.au/books?id\u003dkDIFAAAAQAAJ\u0026amp;pg\u003dPA401\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4voRUfT4KenSmAXkp4F4\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 401\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It was in vain that I petitioned, appealing to our \u0027\u0027caterer\u0027\u0027, if proofs of appetite were wanting; for sick men seldom have occasion for that important person‚Ä≤s services\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1830\u0027\u0027, w:Frederick Frederick Marryat, \u0027The King‚Ä≤s Own\u0027, 1840, \u0027The Complete Works of Captain F. Marryatt\u0027, Volume I, [http://books.google.com.au/books?id\u003d7688AAAAYAAJ\u0026amp;pg\u003dPA335\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4voRUfT4KenSmAXkp4F4\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 335\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúI say, Mr. \u0027Cribbage\u0027,‚Äù cried an old master‚Ä≤s-mate, to the \u0027\u0027caterer\u0027\u0027, who had entered shortly after the tea-kettles, and assumed his place at the end of the table, ‚Äúwhat sort of stuff do you call this\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1838\u0027\u0027, \u0027The Southern Literary Messenger\u0027, Volume IV, [http://books.google.com.au/books?id\u003d_E4FAAAAQAAJ\u0026amp;pg\u003dPA263\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d4voRUfT4KenSmAXkp4F4\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 263\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"There is a \u0027\u0027caterer\u0027\u0027 for the table, whose sleekness of face, rotundity of person, and general air of comfortable well-being, do great honor to the cheer he provides\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A person or company hired to provide and serve food, usually for a large group and at a location separate from where the food is prepared\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 July 23, Andrew O. Shapiro, \u0027Of Canceled Parties and the Beleaguered Teenager\u0027, \u0027w:New York New York\u0027, [http://books.google.com.au/books?id\u003d_-ACAAAAMBAJ\u0026amp;pg\u003dPA64\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZNwRUYKMCurzmAXR4IFQ\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 64\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"If so, you will probably sign a contract with a \u0027\u0027caterer\u0027\u0027 months, maybe years, in advance and make a substantial down payment\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, John N. Ingham, Lynne B. Feldman, \u0027Dutrieuille, Peter Albert (1838‚Äî1916) and Albert E. Dutrieuille (July 26, 1877‚ÄîApril 25, 1974)\u0027, entry in \u0027African-American Business Leaders: A Biographical Dictionary\u0027, [http://books.google.com.au/books?id\u003dTTha3NavN-sC\u0026amp;pg\u003dPA225\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZNwRUYKMCurzmAXR4IFQ\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 225\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"From a family of French West African descent, Albert Dutrieuille was the last of the great African-American \u0027\u0027caterers\u0027\u0027 in Philadelphia\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Zushe Yosef Blech, \u0027Kosher Food Production\u0027, [http://books.google.com.au/books?id\u003dsmFVSUWXTbkC\u0026amp;pg\u003dPA176\u0026amp;dq\u003d%22caterer%22%7C%22caterers%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dZNwRUYKMCurzmAXR4IFQ\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caterer%22%7C%22caterers%22\u0026amp;f\u003dfalse page 176\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Although many hotels work with outside Kosher \u0027\u0027caterers\u0027\u0027 to provide Kosher services, some have developed their own in-house Kosher catering departments\", \"priority\":20}]}, \"synonyms\":{\"list\":[{\"text\":\"cater\", \"synonymQualifier\":\"OBSOLETE\"},{\"text\":\"obsonator\", \"synonymQualifier\":\"OBSOLETE\"}]}}");

	add("catering", "{\"term\":\"catering\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"English\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The business of providing food and related services; foodservice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The business of providing such services for special occasions\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of one who caters (to something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027, J. D. White, John Hugh McQuillen, George Jacob Ziegler, \u0027The Dental Cosmos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Professional jealousies are always confined to the more ignorant; and education alone will enable us to rise above our catchpenny \u0027\u0027caterings\u0027\u0027 to the prejudices and jealousies of the uninformed\", \"priority\":5}]}, \"synonyms\":{}}");

	add("caterpillar", "{\"term\":\"caterpillar\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027catirpel\u0027 \u0027catirpeller\u0027 probably from \u0027catepelose\u0027 (Modern French \u0027chat\u0027 + \u0027pileux\u0027 (hairy cat) , from \u0027cattus\u0027 + {{m|la|pil≈çsus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The larva of a butterfly or moth; leafworm\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The bird just ate that green \u0027\u0027caterpillar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A vehicle with a caterpillar track; a crawler\", \"priority\":3}]}, \"synonyms\":{}}");

	add("catgut", "{\"term\":\"catgut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cord of great toughness made from the intestines of animals, especially of sheep, used for strings of musical instruments, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The material from which such cords are made\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A sort of linen or canvas, with wide interstices\", \"priority\":3}]}, \"synonyms\":{}}");

	add("cathy", "{\"term\":\"cathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"and of its variant forms, also used as a formal given name in the 20th century\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was named Catherine, but he never called it the name in full, as he had never called the first Catherine short, probably because Heathcliff had a habit of doing so. The little one was always \u0027\u0027Cathy\u0027\u0027, it formed to him a distinction from the mother, and yet, a connection with her\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 , \u0027The Friday Night Knitting Club\u0027, Hodder \u0026amp; Stoughton, ISBN 978-0-340-92219-4, page 124\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cathy\u0027\u0027 sounds like the name of a truck-stop waitress,\u0027 she overheard her father-in-law tell Adam after they returned from their honeymoon. \u0027Tell her to call herself Cat and, for Christ\u0027s sake, get her to stop biting her lip all the time\", \"priority\":4}]}, \"synonyms\":{}}");

	add("cathar", "{\"term\":\"cathar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Recorded since the 16th century; from {{m|la|Catharƒ´}}, from late Greek \u0027Œ∫Œ±Œ∏Œ±œÅŒøŒØ\u0027 (the pure) plural of Ancient greek (to 1453) \u0027Œ∫Œ±Œ∏Œ±œÅœåœÇ\u0027 (pure)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A member of certain so self-styled Novatian and other Christian sects embracing a form of dualism and extraordinary practices adhering to Mary Magdalene\u0027s teachings, persecuted by Roman Catholics as heretics\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Albigenses, famous \u0027\u0027Cathars\u0027\u0027 in and around Albi (southern France), were eradicated in a bloody ‚Äòcrusade‚Äô\", \"priority\":2}]}, \"synonyms\":{}}");

	add("catharsis", "{\"term\":\"catharsis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027Œ∫Œ¨Œ∏Œ±œÅœÉŒπœÇ\u0027 (cleansing, purging) from \u0027Œ∫Œ±Œ∏Œ±ŒØœÅœâ\u0027 (i cleanse) Coined in the dramatic-emotional sense by Aristotle.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A release of emotional tension after an overwhelming vicarious experience, resulting in the purging or purification of the emotions, as through watching a dramatic production (especially a tragedy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any release of emotional tension to the same effect, more widely\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A purification or cleansing, especially emotional\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A therapeutic technique to relieve tension by re-establishing the association of an emotion with the memory or idea of the event that first caused it, and then eliminating it by complete expression (called the abreaction\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Purging of the digestive system\", \"priority\":5}]}, \"synonyms\":{}}");

	add("cathartin", "{\"term\":\"cathartin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|carthartic|in|lang\u003den}}?\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bitter purgative principle of senna. It is a glucoside with the properties of a weak acid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cathay", "{\"term\":\"cathay\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Portuguese\", \"kitan\"], \"text\":\"From Portuguese {{m|pt|Catai}}, from Kitan (Â•ë‰∏π, Q√¨dƒÅn), the Chinese name of a Mongolian tribe who ruled Manchuria from 907-1115 {{C.E.}}. Cognate with Spanish Catay and Russian \u0027–∫–∏—Ç–∞ÃÅ–π\u0027 (china)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The name that was given to northern China by Marco Pol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"by extension, an alternate name for China\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cathedra", "{\"term\":\"cathedra\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027cathedra\u0027 (seat) from Ancient greek (to 1453) \u0027Œ∫Œ±Œ∏Œ≠Œ¥œÅŒ±\u0027 (chair of a teacher, throne) from \u0027Œ∫Œ±œÑŒ¨\u0027 (down) + \u0027·ºïŒ¥œÅŒ±\u0027 (seat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The chair or throne of a bishop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The rank of a bishop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The official chair of some position or office, as of a professor\", \"priority\":3}]}, \"synonyms\":{}}");

	add("cathedral", "{\"term\":\"cathedral\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From \u0027cathedral church\u0027 from {{m|la|ecclƒìsia cathedrƒÅlis||church having a bishop\u0027s seat}}, from Ancient greek (to 1453) \u0027Œ∫Œ±Œ∏Œ≠Œ¥œÅŒ±\u0027 (chair of a teacher, throne) from \u0027Œ∫Œ±œÑŒ¨\u0027 (down) + \u0027·ºïŒ¥œÅŒ±\u0027 (seat)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A big church building, central place for some area.\u0026lt;!--isn\u0027t this a less specific definition of the same thing as is defined by the definition below?--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The principal church of a bishop\u0027s diocese which contains an episcopal throne\", \"priority\":2}]}, \"synonyms\":{}}");

	add("cathepsin", "{\"term\":\"cathepsin\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From the German \u0027kathepsin\u0027 derived from Ancient greek (to 1453) \u0027Œ∫Œ±Œ∏Œ≠œàœâ\u0027 (boil down)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a family of proteases primarily active within lysosomes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("catherine", "{\"term\":\"catherine\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027catherine\u0027 from Ancient greek (to 1453) \u0027Œ±·º∞Œ∫Œ±œÑŒµœÅŒØŒΩŒ∑\u0027 {{m|grc|*·ºôŒ∫Œ±œÑŒµœÅŒØŒΩŒ∑}}, of debated meaning, possibly from \u0027·ºëŒ∫Œ¨œÑŒµœÅŒøœÇ\u0027 (each of the two) or from the name of the goddess Hecate. The spelling with \u0027h\u0027 in Latin languages, German and English, is due to a folk etymology, dating from Roman times, which associated the name with the Ancient Greek \u0027Œ∫Œ±Œ∏Œ±œÅœåœÇ\u0027 (pure) The name belonged to a 4th-century saint and martyr from Alexandria who was tortured on the wheel.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1763\u0027\u0027 Voltaire and Catherine the Great: \u0027Selected Correspondence\u0027. Voltaire, Catherine, Antony Lentin.(Translation from French.)Publ. Oriental Research Partners,1973\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"despite of what you say of my fine name, I think my head is so obstinate and inflexible that the name \u0027\u0027Catherine\u0027\u0027 was well chosen. It suits my character. I was given the name by the late Empress Elisabeth, to whom I owe much; she gave it to me out of affection and out of respect for her mothe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It was named \u0027\u0027Catherine\u0027\u0027, but he never called it the name in full, as he had never called the first \u0027\u0027Catherine\u0027\u0027 short, probably because Heathcliff had a habit of doing so. The little one was always Cathy, it formed to him a distinction from the mother, and yet, a connection with her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027 Carole Gift Page, \u0027Carrie\u0027, Bethany House Publishers (1994), ISBN 155661523X, page 55\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Is that your given name?\u0026quot; \u0026quot;Not exactly. My father named me \u0027\u0027Catherine\u0027\u0027, and my mother nicknamed me Carrie. Nobody calls me \u0027\u0027Catherine\u0027\u0027.\u0026quot; \u0026quot;Oh, but you\u0027re much more a \u0027\u0027Catherine\u0027\u0027 than a Carrie,\u0026quot; observed Peter seriously. \u0026quot;Carrie is simple and mundane; \u0027\u0027Catherine\u0027\u0027 is complex and beautiful.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027 Michael O. Gregory: \u0027The Dead Years\u0027: page 35\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"quot;Yes, \u0027\u0027Catherine\u0027\u0027 sounds like a lovely name. I like it. My new name will be \u0027\u0027Catherine\u0027\u0027.\u0026quot; She rolled the name \u0027\u0027Catherine\u0027\u0027 silently again. The name had character a noble ring to it she really liked it\", \"priority\":7}]}, \"synonyms\":{}}");

	add("catheter", "{\"term\":\"catheter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|cath√©ter|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small tube inserted into a body cavity to remove fluid, create an opening, distend a passageway or administer a drug\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cathetus", "{\"term\":\"cathetus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027cathetus\u0027 from Ancient greek (to 1453) \u0027Œ∫Œ¨Œ∏ŒµœÑŒøœÇ|sc\u003dpolytonic|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A line perpendicular to a surface (or line); in particular, either of the sides of a right triangle other than its hypotenuse\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cathexis", "{\"term\":\"cathexis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) Œ∫Œ¨Œ∏ŒµŒæŒπœÇ (\u0027kathexis\u0027, \u0026quot;holding, retention\u0026quot;). The term entered the English language as a translation for the common everyday German word \u0027Besetzung\u0027, which in the context of psychoanalysis means \u0026quot;occupation\u0026quot; in the sense of a position or something being occupied or filled, and not a military occupation of a place or the filling of job positions (although it can also mean either of these in other contexts). (In English translations, a Greek word was used to be more scientific.)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The concentration of libido or emotional energy on a single object or idea\", \"priority\":1}]}, \"synonyms\":{}}");

