	add("catjang", "{\"term\":\"catjang\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cowpea native to Africa, sometimes , a densely-branched shrubby perennial grown for animal fodder or food\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, \u0027Curare\u0027, Volume 13, [http://books.google.com.au/books?id\u003djVYoAQAAIAAJ\u0026amp;q\u003d%22catjangs%22\u0026amp;dq\u003d%22catjangs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVp-yUs7QAo2jkgXSm4CABw\u0026amp;ved\u003d0CK8BEOgBMBc page 29\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Peanuts (\u0027Arachis hypogaea\u0027) and occasionally \u0027\u0027catjangs\u0027\u0027 or cow peas (\u0027Vigna unguiculata (L.) Walp.\u0027) are grown along the Wahgi Valley (HIDE 1979:14\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, A. O. Latunde-Dada, \u0027Genetic Manipulation of the Cowpea (\u0027Vigna unguiculata\u0027 [L.] Walp.) for Enhanced Resistance ro Fungal Pathogens and Insect Pests\u0027, Nyle C. Brady (editor), \u0027Advances in Agronomy\u0027, Volume 44, [http://books.google.com.au/books?id\u003d-xreLw84XGkC\u0026amp;pg\u003dPA134\u0026amp;dq\u003d%22catjang%22%7C%22catjangs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dk5qyUoTbH4mCkwWBiYCwDg\u0026amp;ved\u003d0CIMDEOgBMD\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catjang%22%7C%22catjangs%22\u0026amp;f\u003dfalse page 134\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Indian cultigroups of \u0027V. unguiculata\u0027 ssp. \u0027unguiculata\u0027, namely, Biflora (the \u0027\u0027catjang\u0027\u0027 bean) and Sesquipedalis (the yardlong or asparagus bean), arose probably by selection from the early cowpea domesticates (Faris, 1965\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Tong Kwee Lim, \u0027Edible Medicinal And Non-Medicinal Plants\u0027, Volume 2: Fruits, [http://books.google.com.au/books?id\u003d4MDEqFGeKVoC\u0026amp;pg\u003dPA968\u0026amp;dq\u003d%22catjang%22%7C%22catjangs%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dk5qyUoTbH4mCkwWBiYCwDg\u0026amp;ved\u003d0CEIQ6AEwA\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catjang%22%7C%22catjangs%22\u0026amp;f\u003dfalse page 968\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Catjang\u0027\u0027 bean is considered to have developed in India from cowpea (cultigroup \u0027Unguiculata\u0027) which originated in West Africa (Ng and Marechal 1985). \u0027\u0027Catjang\u0027\u0027 is widely cultivated in India, China, Kampuchea, Japan, Korea, Laos, Vietnam, Africa and America\", \"priority\":9}]}, \"synonyms\":{}}");

	add("catloaf", "{\"term\":\"catloaf\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|cat|loaf|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The loaflike form of a domestic cat sitting with paws and tail tucked underneath the body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0026quot;Ailsa N Murphy\u0026quot;, \u0027RIP, Silver-The-Cat\u0027 (on Internet newsgroup \u0027rec.arts.sf.fandom\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And Gary never got to see him do the full \u0027\u0027catloaf\u0027\u0027, where he curled up face-down so that all that stuck out were the tips of his ears. I never got a picture of that, either\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0026quot;Franz Bestuchev\u0026quot;, \u0027catloaf\u0027 (on Internet newsgroup \u0027alt.support.depression\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One must often attend to the tail and ensure it remains tucked and not become flippant, so as to maintain a \u0027\u0027catloaf\u0027\u0027 of presentable form\", \"priority\":5}]}, \"synonyms\":{}}");

