	add("catperson", "{\"term\":\"catperson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cat|person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An anthropomorphic feline, or an individual who has characteristics of a cat on an otherwise human body, such as cat ears and a cat tail\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Timothy Rowlands, \u0027Video Game Worlds: Working at Play in the Culture of\u0027 EverQuest, Left Coast Press (2012), ISBN 9781611320671, [http://books.google.com/books?id\u003dhVpHBtyaUJcC\u0026amp;pg\u003dPA69 page 69\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I haven\u0027t seen one of my earliest acquaintances in the game, a \u0027\u0027catperson\u0027\u0027 berserker named Silverkat, since Ugeta was just a lowbie\", \"priority\":3}]}, \"synonyms\":{}}");

