	add("catsicle", "{\"term\":\"catsicle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cat|sicle|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cold or frozen cat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, David Bennun, \u0027Tick Bite Fever\u0027, Random House (2004), ISBN 9780091897437, [https://books.google.com/books?id\u003d6nECCawC6zwC\u0026amp;pg\u003dPA145\u0026amp;dq\u003d%22catsicle%22 page 145\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The cat\u0027s gone,\u0027 my father said. \u0027Face it, that cat can hardly stay alive inside the house. She\u0027s not coming back. And if you hold the door open much longer, the rest of us will freeze to death too\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Poppy!\u0027 my stepmother shouted\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She\u0027s frozen now,\u0027 I said helpfully. \u0027She\u0027s a \u0027\u0027catsicle\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Nina Malkin, \u0027An Unlikely Cat Lady: Feral Adventures in the Backyard Jungle\u0027, Globe Pequot (2006), ISBN 9781592289721, [https://books.google.com/books?id\u003daF-yRar1hJYC\u0026amp;pg\u003dPA48\u0026amp;dq\u003d%22catsicles%2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22catsicles%22 page 48\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"I know for damn sure watching \u0027\u0027catsicles\u0027\u0027 form outside my kitchen window would drive me out of my mind with guilt\", \"priority\":8}]}, \"synonyms\":{}}");

	add("catslaughter", "{\"term\":\"catslaughter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|cat|slaughter|lang\u003den}}. Compare {{m|en|manslaughter}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The killing of a cat, the slaughter of cats; felicide\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1862\u0027\u0027, Mrs. Alfred Gatty, \u0027Aunt Judy\u0027s Letters\u0027, page 9\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"After a long and patient investigation of facts, the Coroner returned a verdict of wilful \u0027\u0027catslaughter\u0027\u0027 against a party or parties unknown\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027Southern Pacific Bulletin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Bill intends to file a charge of \u0026amp;quot;\u0027\u0027catslaughter\u0027\u0027\u0026amp;quot; against the villian when caught\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027, Horace Annesley Vachell, \u0027Nether Applewhite: A Story of Strange Lives in an English Village\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And then he committed ‚Äî \u0027\u0027catslaughter\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Caleb, although sensible that his leg had been pulled, roared with laughter\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Al Martinez, \u0027Barkley: A Dog\u0027s Journey\u0027 (ISBN 9781883318604\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Had Barkley done in the Topeka cat, it may have been manslaughter, or \u0027\u0027catslaughter\u0027\u0027, I guess, but not murder\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Michael Lawrence, \u0027Jiggy McCue: Kid Swap\u0027, Hachette UK (ISBN 9781408306680\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The woman was suing the fire service for \u0027\u0027catslaughter\", \"priority\":12}]}, \"synonyms\":{}}");

