	add("cattle", "{\"term\":\"cattle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027catel\u0027 () from Anglo-norman \u0027catel\u0027 (lang\u003dfro) from (compare French \u0027cheptel\u0027 Old French \u0027chetel\u0027 \u0027chatel\u0027 also English \u0027chattel\u0027 from {{m|la|capitƒÅle}}, from Latin {{m|la|capitƒÅlis||of the head}}, from \u0027caput\u0027 (head) + \u0027-alis\u0027 (-al)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Domesticated bovine animals (cows, bulls, steers etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Do you want to raise \u0027\u0027cattle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Certain other livestock, such as sheep, pigs or horses\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"People who resemble domesticated bovine animals in behavior or destiny\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"chatte\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"goods and \u0027\u0027cattle\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"w:Stephen Henry Stephen Henry Roberts, \u0027The Squatting Age in Australia, 1835‚Äì1847\u0027,\u0026lt;sup \u0026gt;[http://books.google.com/books?id\u003d4l8NAQAAIAAJ ]\u0026lt;/sup\u0026gt; Melbourne University Press (1964), page 315\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The temptation of a lone white man was too great for any gathering of \u0027myall\u0027-natives, and sheep-fat and \u0027\u0027cattle\u0027\u0027-steak seemed there for the spearing, so that a stockman always ran the risk of attack, especially if his shepherds interfered with the native women\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Barry Hannah, ‚ÄúEating Wife and Friends‚Äù, in \u0027Airships\u0027, Grove Press (1994), ISBN 978-0-8021-3388-5, [http://books.google.com/books?id\u003dfA0Fga8g3jgC\u0026amp;pg\u003dPA137\u0026amp;dq\u003dcattle page 137\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúBut you cooked a human being and ate him,‚Äù say I\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"‚ÄúI couldn‚Äôt help it,‚Äù says she. ‚ÄúI remember the \u0027\u0027cattle\u0027\u0027 steaks of the old days, the juicy pork, the dripping joints of lamb, the venison\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 April 3, Emmett Jordan, \u0026quot;[http://groups.google.com/group/talk.politics.animals/msg/d2b7d196db4bed1b?q\u003dcattle Re: AR activist arrested for spreading \u0027Mad Cow\u0027 disease in US]\u0026quot;, in \u0026lt;tt\u0026gt;rec.food.veg\u0026lt;/tt\u0026gt;, \u0027Usenet\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Believe it or not Big Mac is one of the ultra radicals who provide fast food \u0027\u0027cattle\u0027\u0027 burgers to interstate vehicles who drive all over the place providing scraps for rats, cats, flies, etc, so that the Mad Cow Disease might spread even faster than it would otherwise do\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 June 25, \u0026quot;Serge\u0026quot; (username), \u0026quot;[http://groups.google.com/group/aus.politics/msg/00a4fc308fd6dd59?q\u003dcattle Re: WOW!!!! WHALE BURGERS...... McDonalds Don\u0027t You Get Any Ideas]\u0026quot;, in \u0026lt;tt\u0026gt;aus.politics\u0026lt;/tt\u0026gt; and other newsgroups, \u0027Usenet\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"If a particular whale species isn\u0027t endangered, then there\u0027s not a blind bit of difference between butchering them or cattle\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Whale burgers. \u0027\u0027Cattle\u0027\u0027 burgers......no difference\", \"priority\":16}]}, \"synonyms\":{}}");

